let preprocessedDataset = []

/**
 * Preprocesses the dataset for optimized filtering and searching.
 *
 * @param {Array<Object>} dataset - Original dataset.
 * @returns {Array<Object>} - Preprocessed dataset witdh additional search field.
 */
function preprocessDataset(dataset) {
	return dataset.map((row) => ({
		...row,
		_searchField: Object.values(row)
			.filter((value) => typeof value === 'string') // Include only strings for searching
			.map((value) => value.toLowerCase())
			.join(' '),
	}))
}

/**
 * Filters and searches the dataset in one pass.
 *
 * @param {string} query - Search query.
 * @param {string} region - Selected region filter.
 * @param {string} service - Selected service filter.
 * @param {Array<Object>} dataset - Preprocessed dataset.
 * @returns {Array<Object>} - Filtered and searched results.
 */
function filterAndSearchDataset(query, region, service, dataset) {
	const lowerQuery = query.toLowerCase()

	return dataset.filter((item) => {
		const matchesRegion = region === 'all' || item.Regio === region
		const matchesService = service === 'all' || item.Hulpdienst === service
		const matchesSearch = lowerQuery === '' || item._searchField.includes(lowerQuery)

		return matchesRegion && matchesService && matchesSearch
	})
}

/**
 * Renders a visible portion of the dataset for improved performance.
 *
 * @param {Array<Object>} dataset - Dataset to render.
 */
function generateVisibleRows(dataset, amount) {
	const tableBody = document.getElementById('list_table').querySelector('tbody')
	const rows = table.querySelectorAll('tr:not(:has(th))')
	rows.forEach((row) => row.remove())

	// Limit rows to render (e.g., 100 rows visible at a time)
	const rowsToRender = dataset.slice(0, amount)

	rowsToRender.forEach((row, index) => {
		const tr = document.createElement('tr')

		if (index % 2 === 0 && row.Roepnaam != '') tr.classList.add('list_even')
		if (row.Roepnaam === '' && row.Adres != '') tr.classList.add('list_address')

		Object.entries(row).forEach(([key, value]) => {
			if (key === '_searchField' || key === 'Hulpdienst' || key === 'Regio') return // Skip unnecessary fields

			const td = document.createElement('td')
			td.textContent = value
			tr.appendChild(td)
		})

		tableBody.appendChild(tr)
	})
}

/**
 * Debounces a function to limit execution frequency.
 *
 * @param {Function} func - Function to debounce.
 * @param {number} delay - Delay in milliseconds.
 * @returns {Function} - Debounced function.
 */
function debounce(func, delay) {
	let timer
	return (...args) => {
		clearTimeout(timer)
		timer = setTimeout(() => func(...args), delay)
	}
}

function updAndClear() {
	count = 100
	updateList()
}

// Event listener to update the table
const updateList = debounce(() => {
	const filteredData = filterAndSearchDataset(input.value, regio.value, hulpdienst.value, preprocessedDataset)
	generateVisibleRows(filteredData, count)
}, 150) // Debounce by 300ms

// Initial setup
document.addEventListener('DOMContentLoaded', () => {
	count = 100
	preprocessedDataset = preprocessDataset(LijstNederland) // Preprocess dataset once
	updateList()
})

// Scrolling
window.onscroll = () => {
	const { scrollTop, clientHeight, scrollHeight } = document.documentElement

	if (scrollTop + clientHeight + 1 > scrollHeight) {
		count += 100
		updateList()
	}
}

// Attach debounced event listeners
input.addEventListener('input', updAndClear)
regio.addEventListener('change', updAndClear)
hulpdienst.addEventListener('change', updAndClear)
